import Cave from './components/files/cave.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={Cave} className="header-img" alt="Ocean CAve" />
      </header>
      <body className='portfolio-body'>
        <div className='welcome-area'>
          <h1 className='intro'>Hello, my name is Tyler!</h1>
        </div>
      </body>

    </div>
  );
}

export default App;
